import tableMixin from '@/mixins/table.mixin';
import { columns } from "./list.config";
import { ListService } from "../list.service";
import CoursePriceSettingShopUpdate from '@/views/biz-modals/course/price-setting-shop-update';
import CoursePriceSettingShop from '@/views/biz-modals/course/price-setting-shop';
import CourseSupportCourseCoaches from '@/views/biz-modals/course/support-course-coaches';
import CourseSupportCourseShops from '@/views/biz-modals/course/support-course-shops';
export default {
  name: 'ShopSaleListTable',
  mixins: [tableMixin],
  modals: {
    CoursePriceSettingShopUpdate: CoursePriceSettingShopUpdate,
    CoursePriceSettingShop: CoursePriceSettingShop,
    CourseSupportCourseCoaches: CourseSupportCourseCoaches,
    CourseSupportCourseShops: CourseSupportCourseShops
  },
  computed: {
    columns: columns
  },
  serviceInject: function serviceInject() {
    return {
      service: ListService
    };
  },
  rxState: function rxState() {
    return {
      list: this.service.list$,
      page: this.service.page$,
      loading: this.service.loading$
    };
  },
  methods: {
    onConfirmDeleteCourse: function onConfirmDeleteCourse(record) {
      this.$emit('delete-course', record.course_id);
    },
    onCLickCoursePrice: function onCLickCoursePrice(record) {
      if (record.sell_price.course_price === '设置定价') {
        this.$modalRouter.push({
          name: 'course-price-setting-shop-update',
          props: {
            id: record.course_id
          }
        });
      } else {
        this.$modalRouter.push({
          name: 'course-price-setting-shop',
          props: {
            course: record
          }
        });
      }
    },
    onConfirmSetAvailable: function onConfirmSetAvailable(record) {
      this.$emit('set-available', record);
    }
  }
};
